import React, { Component } from 'react';

import "../css/ImageGallery.css";

class ImageGallery extends Component {

    componentDidMount() {
    }

    render() {
        return (
            <div id="EventImageCarousel" className="carousel slide" data-ride="carousel">

                <ol className="carousel-indicators">
                    <li data-target="#EventImageCarousel" data-slide-to="0" className="active"></li>
                    <li data-target="#EventImageCarousel" data-slide-to="1"></li>
                    <li data-target="#EventImageCarousel" data-slide-to="2"></li>
                </ol>
                <div className="carousel-inner">
                    <div className="carousel-item active">
                        <img className="d-block w-100" src="img/Basic_Event_FondoNegro.png" alt="First slide" />
                    </div>
                    <div className="carousel-item">
                        <img className="d-block w-100" src="img/Basic_Event.png" alt="Second slide" />
                    </div>
                    <div className="carousel-item">
                        <img className="d-block w-100" src="img/Basic_Event_FondoNegro.png" alt="Third slide" />
                    </div>
                </div>
                <a className="carousel-control-prev" href="#EventImageCarousel" role="button" data-slide="prev">
                    <span className="carousel-control-prev-icon" aria-hidden="true"></span>
                    <span className="sr-only">Previous</span>
                </a>
                <a className="carousel-control-next" href="#EventImageCarousel" role="button" data-slide="next">
                    <span className="carousel-control-next-icon" aria-hidden="true"></span>
                    <span className="sr-only">Next</span>
                </a>
            </div>
        );
    }
}

export default ImageGallery;
